import { InnerPagesTopTitle } from "../../../../../common/InnerPagesTopTitle/InnerPagesTopTitle";
let defaultImage = "https://source.unsplash.com/random/500x500/?girl";

export const AllNotifications = () => {
  return (
    <>
      <div className="custom_container">
        <div className="inner_custom_container">
          <div className="user_managemen_top_title">
            <InnerPagesTopTitle name="Notifications" />
          </div>
          <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3 ">
            <div className="col-12">
              <NotificationsList />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

const NotificationsList = ({ background = defaultImage }) => {
  return (
    <>
      <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3 ">
        <div className="col-12">
          <div className="row">
            <div className="col-3">
              <div
                className="notifications_img_icon"
                style={{
                  backgroundImage: `url(${background})`,
                }}
              ></div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
